import React from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import styled from 'styled-components';
import { mobile } from '../responsive';


const Main = styled.div`
${mobile({display:"grid"})}

`
const Btn = styled.button`
  transition: all 0.3s ease-in-out;
  font-family: "Dosis", sans-serif;
  width: 100px;
  height: 40px;
  border-radius: 50px;
  background-image: linear-gradient(135deg, #feb692 0%, #ea5455 100%);
  box-shadow: 0 20px 30px -6px rgba(238, 103, 97, 0.5);
  outline: none;
  cursor: pointer;
  border: none;
  font-size: 14px;
  color: white;

  &:hover {
    transform: translateY(3px);
    box-shadow: none;
  }

  &:active {
    opacity: 0.5;
  }
  ${mobile({flex:"1", fontSize:"10px"})}
`;

const NavbarBrand  = styled.h1`
`

const Header = ({location,reload,handlecheck}) => {

  return (
    <Main>
         <Navbar bg="dark" data-bs-theme="dark">
            <Container>
            <Navbar.Brand  className="ml-auto" style={{fontSize:30, fontWeight:900}}>Weather Data</Navbar.Brand>
                  <Nav className="ml-auto" >

                    <Form inline >
                            <Row>
                                <Col >
                                    <Form.Control
                                    type="text"
                                    placeholder="Search"
                                    className=" mr-sm-2"
                                    value={location}
                                    onChange={handlecheck}
                                    />
                                </Col>
                                <Col xs="auto">
                                    <Btn onClick={reload}  type="submit">Reload</Btn>
                                </Col>
                            </Row>
                    </Form>
                  </Nav>
            </Container>
      </Navbar>

    </Main>
  );
}

export default Header;
